import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";

function Orders() {
  const[orderList, setOrderList] = useState([])
  useEffect(() => {
    getOrderList();
  });

  const getOrderList = () => {
    const order = [
      {
        productId: "52",
        customerId: "45",
        productName: "T- sirt",
        startDate: "5-1-29",
        amount: "pending",
        
      },
      {
        productId: "82",
        customerId: "45",
        productName: "T- Borka",
        startDate: "9-5-29",
        amount: "active",
        
      },
     
    ];
    setOrderList(order);
  };
  return (
    <div>
      <main className="mt-5 pt-2">
        <div className="container-fluid">
          <div className="row">
            <div className="col-md-12 fw-bold fs-4">Orders list</div>
          </div>
          <div className="row">
            <div className="col col-md-12">
              <table className="table">
                <thead>
                  <tr>
                    <th scope="col">PRODUCT__ID</th>
                    <th scope="col">CUSTOMER__ID</th>
                    <th scope="col">PRODUCT NAME</th>
                    <th scope="col">START DATE</th>
                    <th scope="col">AMOUNT</th>
                    <th scope="col">DETAILS</th>
                  </tr>
                </thead>
                <tbody>
                {orderList.map((order, index) => (
                  <tr>
                      <th scope="row">{order.productId}</th>
                      <td>{order.customerId}</td>
                      <td>{order.productName}</td>
                      <td>{order.startDate}</td>
                      <td>{order.amount}</td>
                      <td>
                        <Link to="customer" className="btn btn-warning px-3">
                            Details
                        </Link>
                    </td>
                  </tr>
                      ))}
                 
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </main>
    </div>
  );
}

export default Orders;
